E_D("replace into `phome_ecms_game` values('5338','14','0','','','','1','admin','|26|','1','0','1343236953','0','0','0','0','','','5338','0','0','0','0','0','0','做个小孩不容易','1343236953','/spic/20120725/8815.jpg','0','1','1343236953','0','3','1','0','','0','','/d/file/swf/genwozuo.swf','667','479','大人总是羡慕我们无忧无虑，大人总是以为我们快乐无比。<br />其实他们不知道哇不知道，做个小孩可真是不容易！<br />在家里，我是受气的小皇帝。<br />妈妈也讲，爸爸也讲， 全都是做人的大道理。<br />在学校，老师是那么的严厉。<br />要好成绩，要好纪律，多少做不完的练习题！<br />哎哟哟，哎哟哟，做个小孩唉！真是不容易！<br />大人总是羡慕我们无忧无虑，大人总是以为我们快乐无比。<br />其实他们不知道哇不知道，做个小孩可真是不容易！<br />眼巴巴，盼来一个星期天。<br />练琴学画，补习英语，偏 偏就不能把足球踢！<br />走在街上，总算找到了我自己，<br />想跳就跳，随心所欲，行人却说我多动太淘气！<br />哎哟哟，哎哟哟，做个小孩唉！<br />真是不容易！真是不容易！唉！','1','','0','','1','/dpic/20120725/8816.jpg','4823','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREprYkdKdVpIWmxibFoyVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/genwozuo.swf','http://www.61baobao.com/common/flash/2006/dpic/genwozuo.jpg','http://www.61baobao.com/common/flash/2006/pic/240.jpg','0','三个月以上','0','','0','','0','0','0');");
