E_D("replace into `phome_ecms_game` values('5348','14','0','','','','1','admin','','1','0','1343236957','0','0','0','0','','','5348','0','0','0','0','0','0','猪都笑了儿童版','1343236957','/spic/20120725/8805.jpg','0','1','1343236957','0','3','1','0','','0','','/d/file/swf/4816.swf','667','479','小青蛙说它嘴巴大， 河马叔叔就笑了；<br />河马叔叔说它个子大， 大象爷爷就笑了；<br />大象爷爷说它啥都不怕， 老鼠弟弟就笑了；（咬你耳朵）<br />老鼠说它爱大米， 母鸡阿姨就笑了。（咯咯咯咯）<br /><br /><br />母鸡阿姨说它会唱歌， 鹦鹉哥哥就笑了；<br />鹦鹉哥哥说它眼睛大， 小燕子姐姐就笑了；(我是还珠格格)<br />小燕子说它最可爱， 小狗狗就笑了；<br />小狗狗说它最聪明， 大猩猩就笑了。<br /><br />啦。。。。。。。。 米奇老鼠唐老鸭，<br />大猩猩说它是人模样， 胖呼呼的猪都笑了。<br /><br /><br />天鹅姑姑说它最美丽， 孔雀姐姐就笑了；<br />孔雀姐姐说它很骄傲， 小白兔就笑了；<br />小白兔说它跑得快， 老乌龟就笑了（龟兔赛跑）<br />老乌龟说它是国宝啊， 大熊猫就笑了。<br /><br />啦。。。。。。。。 团团又圆圆，<br />大熊猫说它去台湾啊， 全国人民都笑了。<br /><br />','1','','0','','1','/dpic/20120725/8806.jpg','4816','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRTBUVlJaZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4816.swf','http://www.61baobao.com/common/flash/d/dpic/4816.jpg','http://www.61baobao.com/common/flash/d/pic/4816.jpg','0','三个月以上','0','','0','','0','0','0');");
