E_D("replace into `phome_ecms_game` values('5363','14','0','','','','1','admin','','1','0','1343236962','0','0','0','0','','','5363','0','0','0','0','0','0','I want to fly','1343236962','/spic/20120725/8797.jpg','0','1','1343236962','0','3','1','0','','0','','/d/file/swf/4811.swf','667','479','I want to fly fly in the sky just like bird freedomly 我要飞翔 飞在蓝天上像那小鸟一样自由自在歌曲简介制作〈有志者事竟成〉带给我的惊喜，我足足一晚上睡不着觉，直到早上，半梦半醒的我变成一只小鸟，在天空中飞呀飞呀，美得不得了，最后小鸟被往网住了，我也醒了，我还在回味飞的感觉，于是我写下了〈我要飞翔〉，最后歌名改为〈I want to fly〉因为觉得〈我要飞翔〉已有同名歌曲，太俗，这样的话更时尚。这首歌的歌词非常简单，由于用中英文演唱所以听起来并不单调；音乐的制作采用了当今国际流行的手法，小歌手段丽阳也借用了流行唱法，给儿歌制作带来了新的理念，找到了大人和孩子欣赏音乐的共同点。流行歌曲又多了新的内容。','1','','0','','1','/dpic/20120725/8798.jpg','4811','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRTBUVlJGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4811.swf','http://www.61baobao.com/common/flash/d/dpic/4811.jpg','http://www.61baobao.com/common/flash/d/pic/4811.jpg','0','三个月以上','0','','0','','0','0','0');");
